export default (function(a,b,c,d,e){return {data:{cNYoI8X8SV:{data:{id:536,attributes:{imdbId:"tt1939659",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODg2MDU2MjYxNl5BMl5BanBnXkFtZTcwMDQ5MzU0OQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.9\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:1199,attributes:{title:a,plot:"The outcast teenager Carrie White is bullied by her classmates at high school. Her mother, Margaret White, is a pious and paranoid woman that sees sin everywhere and the need of self-inflicting punishment. When Carrie has her first period, she does not understand what is happening to her and her classmates humiliate her in the changing room. The spiteful Chris Hargensen videotapes Carrie with her cellphone and posts it on the Internet. Their teacher Ms. Desjardin punishes the students, but when Chris challenges her, she is suspended and consequently is banned from the prom. Meanwhile, Carrie discovers that she has telekinesis and learns how to control her ability. Sue Snell, one of the girls that tormented Carrie, feels bad and asks her boyfriend Tommy Ross to invite Carrie to go with him to the prom to make up for what she did to Carrie. But Chris and her boyfriend Billy Nolan plot an evil prank with her friends to get back at Carrie.",slug:"carrie"}}},books:{data:[{id:3937,attributes:{title:a,description:"El escalofriante caso de una joven de apariencia insignificante que se transformo en un ser de poderes anormales, sembrando el terror en la ciudad. Con pulso magico para mantener la tension a lo largo de todo el libro, Stephen King narra la atormentada adolescencia de Carrie, y nos envuelve en una atmosfera sobrecogedora cuando la muchacha realiza una serie de descubrimientos hasta llegar al terrible momento de la venganza. Esta novela fue llevada al cine con un inmenso exito de publico y critica.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6nZ9PwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,e],firstBook:true,published:"2006-01-01",publisher:"Plaza Y Janes Mexico",subtitle:b}},{id:3938,attributes:{title:a,description:"An introverted girl with remarkable powers of telekinesis faces the horrors of teenage life and unleashes a few horrors of her own when she attends the high school prom",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=DP_XAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1975-01-01",publisher:"Berkley",subtitle:b}},{id:3939,attributes:{title:a,description:"Stephen King's legendary debut, the bestselling smash hit that put him on the map as one of America's favorite writers \"Gory and horrifying. . . . You can't put it down.\" —Chicago Tribune Unpopular at school and subjected to her mother's religious fanaticism at home, Carrie White does not have it easy. But while she may be picked on by her classmates, she has a gift she's kept secret since she was a little girl: she can move things with her mind. Doors lock. Candles fall. Her ability has been both a power and a problem. And when she finds herself the recipient of a sudden act of kindness, Carrie feels like she's finally been given a chance to be normal. She hopes that the nightmare of her classmates' vicious taunts is over . . . but an unexpected and cruel prank turns her gift into a weapon of horror so destructive that the town may never recover.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FNxGvn1SCVMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2008-06-24",publisher:"Anchor",subtitle:b}},{id:3940,attributes:{title:a,description:"A dix-sept ans, solitaire, timide et pas vraiment jolie, Carrie White vit un calvaire, victime du fanatisme religieux de sa mère et des moqueries incessantes de ses camarades de classe. Sans compter ce don, cet étrange pouvoir de déplacer les objets à distance, bien qu'elle le maîtrise encore avec difficulté... Un jour, cependant, la chance paraît lui sourire. Tommy Ross, le seul garçon qui semble la comprendre et l'aimer, l'invite au bal de printemps de l'école. Une marque d'attention qu'elle n'aurait jamais espérée, et peut-être même le signe d'un renouveau ! Loin d'être la souillonne que tous fustigent, elle resplendit et se sent renaître à la vie. Mais c'est compter sans l'aigreur et la mesquinerie des autres élèves. Cette invitation, trop belle pour être vraie, ne cache-t-elle pas un piège plus cruel encore que les autres ?",thumbnail:b,authors:[c],firstBook:d,published:"2001-01-01",publisher:"J'ai lu",subtitle:b}},{id:3941,attributes:{title:a,description:"El escalofriante caso de una joven en apariencia insignificante que se transformó en un ser de poderes anormales, sembrando el terror en su ciudad. Con pulo mágico para mantener la tensión a lo largo de todo el libro, Stephen King narra la atormentada adolescencia de Carrie, y nos envuelve en una atmósfera sobrecogedora cuando la muchacha realiza una seie de descubrimientos hasta llegar al terrible momento de la vengaza. esta novela fue llevada al cina y obtuvo un imenso éxito de público y de crítica.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Nkv1T2ZyN-0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,e],firstBook:d,published:"2001-09-01",publisher:"Plaza y Janes",subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940939477}}("Carrie","","Stephen King",null,"Gregorio Vlastelica"))